      <div class="modal-body">
        <b>Brand</b><br>
        <i style="font-size: 14px;">Ex. Gucci, Gap, Coach and Zara</i><br>
        <p>If you see the "Brand" icon, this means that they have their own design or produce their own goods.</p>
        
        <b>Store</b><br>
        <i style="font-size: 14px;">Ex. Nordstrom, Macy's, and Shopbop</i><br>
        <p>When you come across the "Store" icon, this means they carry multiple brands.</p>
        
        <b>Outlet</b><br>
        <i style="font-size: 14px;">Ex. Nordstroms Rack, Barneys Warehouse, and Saks Off 5th</i><br>
        <p>If you see the Outlet icon, companies that fall under this category are classified as selling product that is under
          price or deeply discounted.</p>
        
        <b>Boutique</b><br>
        <i style="font-size: 14px;">Ex. Vici Collection, The Pink Lily, and Garmentory</i><br>
        <p>When you see the "Boutique" icon, this means hey are smaller in size and carry brands/styles with a curated theme.
        </p>
      </div>

    </div>
  </div>
</div>
<div class="modal fade" id="modalRating" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel"
  aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">

      <div class="modal-header">
        <div class="modal-title"><a href="" style="text-transform:uppercase;cursor:initial">Editor's Score</a></div>
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>

      <div class="modal-body">
        <p>When our team reviews a store or brand, we review based on the following criteria:</p>
        <p>The stores product quality, price, design, and customer reviews; afterwards, we then compare that same store to its
          similar brands.</p>
        <p>So, if you see a higher score, that means we feel that the particular store has a better at price point, product ,
          and overall quality in comparison to their competitors. If you see a lower score, then they do not meet the criteria
          that we have in place.</p>
      </div>

    </div>
  </div>
</div>
<div class="modal fade" id="modalSimilarity" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel"
  aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">

      <div class="modal-header">
        <div class="modal-title"><a href="" style="text-transform:uppercase;cursor:initial">Similarity Score</a></div>
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>

      <div class="modal-body">
        <b>How we find similar stores and calculate similarities</b>
        <p>We attain data from web statistic companies and analyze each website's visitors.</p>
        <p>To find similar stores, we analyze where majority of visitors from a particular website visit. We then evaluate where
          a shopper goes afterwards and then we begin to sort the stores by similarity scores.</p>
        
        <b>Similarity Gauge</b>
        
        <p>We measure websites by related scores and separate into groups.</p>
        <p>If a website has a <span class="progress modal-progress"><span class="progress-bar very-similar"><span
                class="progress-span">Very Similar</span></span></span> rating, it means that particular website is the closest
          match to the one you searched for. Meaning they have similar product lines, styles, and pricing points. Also, their
          visitors are highly overlapped by gender, age, and interest.</p>
        
        <p>For <span class="progress modal-progress"><span class="progress-bar regular-similar"><span
                class="progress-span">Similar</span></span></span> and <span class="progress modal-progress"><span
              class="progress-bar somewhat-similar"><span class="progress-span">Somewhat Similar</span></span></span>, they
          might not be a perfect match, but can meet somewhere in the middle when it comes to products.</p>
        
        <p><span class="progress modal-progress"><span class="progress-bar less-similar"><span class="progress-span">Less
                Similar</span></span></span> means their products might not align with your main store according to our
          calculations, but sometimes those unlikely products just might be what you need and are worth a try.</p>
      </div>

    </div>
  </div>
</div>

  

